import React from 'react';
import {
  Container,
  Typography,
  Grid,
  Card,
  CardContent,
  Box,
  Button,
  LinearProgress,
  Chip,
  IconButton,
} from '@mui/material';
import {
  Security,
  Warning,
  CheckCircle,
  Error,
  TrendingUp,
  Refresh,
  CloudUpload,
  Scanner,
} from '@mui/icons-material';

const Dashboard: React.FC = () => {
  const stats = [
    {
      title: 'Total Scans',
      value: '1,247',
      change: '+12%',
      icon: <Scanner sx={{ fontSize: 40, color: '#6366f1' }} />,
      color: '#6366f1',
    },
    {
      title: 'Critical Issues',
      value: '23',
      change: '-8%',
      icon: <Error sx={{ fontSize: 40, color: '#ef4444' }} />,
      color: '#ef4444',
    },
    {
      title: 'Resolved Issues',
      value: '156',
      change: '+24%',
      icon: <CheckCircle sx={{ fontSize: 40, color: '#10b981' }} />,
      color: '#10b981',
    },
    {
      title: 'Active Rules',
      value: '150',
      change: '+5%',
      icon: <Security sx={{ fontSize: 40, color: '#06b6d4' }} />,
      color: '#06b6d4',
    },
  ];

  const recentScans = [
    { file: 'terraform/main.tf', issues: 12, severity: 'high', time: '2 min ago' },
    { file: 'infrastructure/vpc.tf', issues: 3, severity: 'medium', time: '15 min ago' },
    { file: 'security/iam.tf', issues: 8, severity: 'critical', time: '1 hour ago' },
    { file: 'compute/ec2.tf', issues: 5, severity: 'low', time: '2 hours ago' },
  ];

  const getSeverityColor = (severity: string) => {
    switch (severity) {
      case 'critical': return '#ef4444';
      case 'high': return '#f59e0b';
      case 'medium': return '#06b6d4';
      case 'low': return '#10b981';
      default: return '#6b7280';
    }
  };

  return (
    <Container maxWidth="xl" sx={{ py: 4 }}>
      {/* Hero Section */}
      <Box sx={{ mb: 6, textAlign: 'center' }}>
        <Typography variant="h1" sx={{ mb: 2 }}>
          Security Dashboard
        </Typography>
        <Typography variant="body1" sx={{ fontSize: '1.2rem', mb: 4, maxWidth: 600, mx: 'auto' }}>
          Monitor your infrastructure security posture with real-time insights and automated scanning
        </Typography>
        <Box sx={{ display: 'flex', gap: 2, justifyContent: 'center' }}>
          <Button
            variant="contained"
            size="large"
            startIcon={<Scanner />}
            sx={{ px: 4 }}
          >
            Start New Scan
          </Button>
          <Button
            variant="outlined"
            size="large"
            startIcon={<CloudUpload />}
            sx={{ 
              px: 4,
              borderColor: 'rgba(255, 255, 255, 0.2)',
              color: '#cbd5e1',
              '&:hover': {
                borderColor: '#6366f1',
                backgroundColor: 'rgba(99, 102, 241, 0.1)',
              },
            }}
          >
            Upload Logs
          </Button>
        </Box>
      </Box>

      {/* Stats Grid */}
      <Grid container spacing={3} sx={{ mb: 6 }}>
        {stats.map((stat, index) => (
          <Grid item xs={12} sm={6} md={3} key={index}>
            <Card sx={{ height: '100%' }}>
              <CardContent sx={{ p: 3 }}>
                <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between', mb: 2 }}>
                  {stat.icon}
                  <Chip
                    label={stat.change}
                    size="small"
                    sx={{
                      backgroundColor: stat.change.startsWith('+') ? 'rgba(16, 185, 129, 0.1)' : 'rgba(239, 68, 68, 0.1)',
                      color: stat.change.startsWith('+') ? '#10b981' : '#ef4444',
                      border: 'none',
                    }}
                  />
                </Box>
                <Typography variant="h3" sx={{ mb: 1, color: stat.color }}>
                  {stat.value}
                </Typography>
                <Typography variant="body2" color="text.secondary">
                  {stat.title}
                </Typography>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>

      <Grid container spacing={3}>
        {/* Recent Scans */}
        <Grid item xs={12} md={8}>
          <Card>
            <CardContent sx={{ p: 3 }}>
              <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between', mb: 3 }}>
                <Typography variant="h4">Recent Scans</Typography>
                <IconButton
                  sx={{
                    '&:hover': {
                      backgroundColor: 'rgba(99, 102, 241, 0.1)',
                    },
                  }}
                >
                  <Refresh />
                </IconButton>
              </Box>
              <Box sx={{ display: 'flex', flexDirection: 'column', gap: 2 }}>
                {recentScans.map((scan, index) => (
                  <Box
                    key={index}
                    sx={{
                      display: 'flex',
                      alignItems: 'center',
                      justifyContent: 'space-between',
                      p: 2,
                      borderRadius: '12px',
                      backgroundColor: 'rgba(255, 255, 255, 0.02)',
                      border: '1px solid rgba(255, 255, 255, 0.05)',
                      '&:hover': {
                        backgroundColor: 'rgba(255, 255, 255, 0.05)',
                      },
                    }}
                  >
                    <Box sx={{ display: 'flex', alignItems: 'center', gap: 2 }}>
                      <Box
                        sx={{
                          width: 8,
                          height: 8,
                          borderRadius: '50%',
                          backgroundColor: getSeverityColor(scan.severity),
                        }}
                      />
                      <Typography variant="body1" sx={{ fontWeight: 500 }}>
                        {scan.file}
                      </Typography>
                    </Box>
                    <Box sx={{ display: 'flex', alignItems: 'center', gap: 2 }}>
                      <Chip
                        label={`${scan.issues} issues`}
                        size="small"
                        sx={{
                          backgroundColor: `${getSeverityColor(scan.severity)}20`,
                          color: getSeverityColor(scan.severity),
                          border: 'none',
                        }}
                      />
                      <Typography variant="body2" color="text.secondary">
                        {scan.time}
                      </Typography>
                    </Box>
                  </Box>
                ))}
              </Box>
            </CardContent>
          </Card>
        </Grid>

        {/* Security Score */}
        <Grid item xs={12} md={4}>
          <Card sx={{ height: '100%' }}>
            <CardContent sx={{ p: 3 }}>
              <Typography variant="h4" sx={{ mb: 3 }}>
                Security Score
              </Typography>
              <Box sx={{ textAlign: 'center', mb: 3 }}>
